import React from 'react';


class LeftNav extends React.Component{
  render(){
  return(
    <div class ="row left-nav group1">
      <div class="col-2 bg-light  sidebar d-flex">
        <div class ="row left-nav group1">
        <div class="col-12 left-col">
        <nav class="navbar left-nav navbar-expand navbar-light">
        <ul class="left-nav nav-item text-left">
          <li class="left-nav nav-link" href="#"><a class="left-nav nav-link" href="\emotion.html"><img src="Icons\Small Icons\mood-24px-grey.svg" alt="" class="left-nav icon"/>Emotion</a></li>
          <li class="left-nav nav-link" href="#"><a class="left-nav nav-link" href="#"><img src="Icons\Small Icons\tactor-grey.svg" alt="" class="left-nav icon"/>Tactor</a></li>
          <li class="left-nav nav-link" href="#"><a class="left-nav nav-link" href="#"><img src="Icons\Small Icons\touch-grey.svg" alt="" class="left-nav icon"/>Behavior</a></li>
        </ul>
      </nav>
        </div>
        </div>

      </div>
      </div>



)
}
}

export default LeftNav;
